create table pcr_credit_acc_pay
(
    id                      varchar(64)    not null comment '主键ID',
    order_id                varchar(64)    null comment '订单流水号',
    serial_id               varchar(64)    null comment '数据流水号',
    etl_id                  varchar(64)    null comment '清洗流水号',
    report_id               varchar(32)    null comment '报告编号',
    pay_account_state_code  varchar(60)    null comment '账户状态',
    close_datetime          datetime       null comment '关闭日期',
    out_month               varchar(20)    null comment '转出月份',
    pay_balance             decimal(12, 2) null comment '余额',
    pay_last_repay_datetime datetime       null comment '最近一次还款日期',
    last_repayment_amount   decimal(12, 2) null comment '最近一次还款金额',
    pay_five_level_code     varchar(60)    null comment '五级分类',
    pay_repay_status_code   varchar(60)    null comment '还款状态',
    update_datetime         datetime       null comment '信息报告日期',
    fk_id                   varchar(32)    null comment '外键FK_ID',
    creditacc_account_no    varchar(30)    null comment '账户编号',
    create_time             datetime       not null comment '入库时间',
    primary key (id, create_time)
)
    comment 'D_01_01-最近表现形式' engine = InnoDB;

create index idx_etl_report_account_no
    on pcr_credit_acc_pay (etl_id, report_id, creditacc_account_no);

